import React, { useState, useEffect } from 'react';
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';
import { useUnreadCount } from '../UnreadCountContext';
import axios from 'axios';

const Navbar = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: black; /* Vanderbilt dark blue */
  padding: 1rem 2rem;
`;

const NavLinks = styled.div`
  display: flex;
  gap: 1.5rem;
`;

const StyledNavLink = styled(NavLink)`
  color: #FFFFFF;
  text-decoration: none;
  font-weight: bold;

  &.active {
    text-decoration: underline;
  }

  &:hover {
    color: #ECEFF1;
  }
`;

const NotificationBadge = styled.span`
  position: absolute;
  top: -14px;
  right: -10px;
  background-color: red;
  color: white;
  border-radius: 50%;
  padding: 4px 10px;
  font-size: 12px;
`;

const SearchContainer = styled.div`
  display: flex;
  align-items: center;
  position: relative;
`;

const SearchBar = styled.input`
  padding: 0.5rem;
  border-radius: 4px;
  border: 1px solid #ccc;
  margin-right: 0.5rem;
  font-size: 1rem;
  outline: none;
  width: 300px;

  &:focus {
    border-color: #B3A369; /* Vanderbilt color */
  }
`;

const SuggestionsBox = styled.div`
  position: absolute;
  top: 50px;
  background-color: white;
  border: 1px solid #ccc;
  border-radius: 4px;
  width: 100%;
  z-index: 10;
  max-height: 200px;
  overflow-y: auto;
`;

const SuggestionRow = styled.div`
  display: flex;
  align-items: center;
  padding: 0.5rem;
  cursor: pointer;

  &:hover {
    background-color: #f9f9f9;
  }
`;

const SuggestionImage = styled.img`
  width: 40px;
  height: 40px;
  border-radius: 50%;
  margin-right: 10px;
`;

const SuggestionText = styled.span`
  font-size: 1rem;
  color: #333;
`;

const Layout = ({ children }) => {
  const { unreadCount } = useUnreadCount();
  const [searchInput, setSearchInput] = useState('');
  const [suggestions, setSuggestions] = useState([]);

  const fetchItems = async () => {
    try {
      const response = await axios.get('http://127.0.0.1:8000/api/v1/items/');
      return response.data; // Return the list of items from the backend
    } catch (error) {
      console.error('Error fetching items:', error.response ? error.response.data : error.message);
    }
  };

  const handleSearch = async (e) => {
    const searchString = e.target.value;
    setSearchInput(searchString);

    if (searchString.trim() === '') {
      setSuggestions([]);
      return;
    }

    const items = await fetchItems();
    const pattern = new RegExp(searchString, 'gi');
    const filteredItems = items.filter((item) => pattern.test(item.name));

    setSuggestions(filteredItems);
  };

  return (
    <>
      <Navbar>
        <NavLink to="/" style={{ color: '#FFFFFF', textDecoration: 'none', fontWeight: 'bold' }}>
          Reuse Vandy
        </NavLink>

        <SearchContainer>
          <SearchBar 
            type="text" 
            placeholder="Search..." 
            value={searchInput} 
            onChange={handleSearch} 
          />
          {suggestions.length > 0 && (
            <SuggestionsBox>
              {suggestions.map((item) => (
                <SuggestionRow key={item._id}>
                  <SuggestionImage src={item.list_of_images[0]} alt={item.name} />
                  <SuggestionText>{item.name}</SuggestionText>
                </SuggestionRow>
              ))}
            </SuggestionsBox>
          )}
        </SearchContainer>

        <NavLinks>
          <StyledNavLink to="/" exact>Home</StyledNavLink>
          <StyledNavLink to="/notifications" style={{ position: 'relative' }}>
            Notifications
            {unreadCount > 0 && (
              <NotificationBadge>{unreadCount}</NotificationBadge>
            )}
          </StyledNavLink>
          <StyledNavLink to="/messages">Messages</StyledNavLink>
          <StyledNavLink to="/sell-item">Sell Your Item</StyledNavLink>
          <StyledNavLink to="/bookmarks">View Bookmarks</StyledNavLink>
        </NavLinks>
      </Navbar>
      <main>{children}</main>
    </>
  );
};

export default Layout;
